describe("PDFSIGN", function() {
    
    var BASE64_MARKER = ';base64,';
    var keyStr = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
    
    //used: http://jpillora.com/base64-encoder/
    var pdfMinimal2 = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfMinimalGap = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfMinimalSigned = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfAlreadySigned = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfAlreadySignedTwice = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfAlreadySignedThree = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfmini = convertDataURIToBinary('data:application/pdf;base64,');
    var pdfminiSigned = convertDataURIToBinary('data:application/pdf;base64,');
    //use the very insecure password: '1234'
    var cert = convertDataURIToBinary('data:application/x-pkcs12;base64,');
    var cert2 = convertDataURIToBinary('data:application/x-pkcs12;base64,');
    
    
    
    //works in browser only
    function createPDFDownload(array, filename) {
        var a = window.document.createElement('a');
        a.href = window.URL.createObjectURL(new Blob([array], { type: 'application/pdf' }));
        a.download = filename;
        // Append anchor to body.
        document.body.appendChild(a);
        a.click();
        // Remove anchor from body
        document.body.removeChild(a);
    }
    
    function convertDataURIToBinary(dataURI) {
        var base64Index = dataURI.indexOf(BASE64_MARKER) + BASE64_MARKER.length;
        var base64 = dataURI.substring(base64Index);
        return decodeBase64(base64);
    }
    
    /**
    *
    *  Base64 encode / decode
    *  http://www.webtoolkit.info/
    *  
    *  window.atob -> browser/node.js dependant, this works on any engine
    *
    **/
    function encodeBase64(input) {
        var output = "";
        var chr1, chr2, chr3, enc1, enc2, enc3, enc4;
        var i = 0;
        while (i < input.length) {
            chr1 = input[i++];
            chr2 = input[i++];
            chr3 = input[i++];
 
            enc1 = chr1 >> 2;
            enc2 = ((chr1 & 3) << 4) | (chr2 >> 4);
            enc3 = ((chr2 & 15) << 2) | (chr3 >> 6);
            enc4 = chr3 & 63;
 
            if (isNaN(chr2)) {
                enc3 = enc4 = 64;
            } else if (isNaN(chr3)) {
                enc4 = 64;
            }
            output = output + keyStr.charAt(enc1) + keyStr.charAt(enc2) + keyStr.charAt(enc3) + keyStr.charAt(enc4);
        }
        return output;
    }

    function decodeBase64(input) {
	var chr1, chr2, chr3;
	var enc1, enc2, enc3, enc4;
	var i = 0;
        var size = 0;
            
	input = input.replace(/[^A-Za-z0-9\+\/\=]/g, "");

        var uint8 = new Uint8Array(input.length);

	while (i < input.length) {

	    enc1 = keyStr.indexOf(input.charAt(i++));
	    enc2 = keyStr.indexOf(input.charAt(i++));
	    enc3 = keyStr.indexOf(input.charAt(i++));
	    enc4 = keyStr.indexOf(input.charAt(i++));

	    chr1 = (enc1 << 2) | (enc2 >> 4);
	    chr2 = ((enc2 & 15) << 4) | (enc3 >> 2);
	    chr3 = ((enc3 & 3) << 6) | enc4;

            uint8[size++] = (chr1 & 0xff);
            if (enc3 !== 64) {
                uint8[size++] = (chr2 & 0xff);
	    }
	    if (enc4 !== 64) {
                uint8[size++] = (chr3 & 0xff);
	    }

	}
        return uint8.subarray(0,size);
    }
    
    function arrayEquals(array1, array2) {
        expect(array1.length).toBe(array2.length);
        for(var i=0, len=array1.length;i<len;i++) {
            expect(array1[i]).toBe(array2[i]);
            if(array1[i] != array2[i]) {
                return;
            }
        }
    }

    it("strhex", function() {
    	expect(PDFSIGN._strHex('M')).toBe('4d');
        expect(PDFSIGN._strHex('\n')).toBe('0a');
	expect(PDFSIGN._strHex('Ma')).toBe('4d61');
    });
    
    it("find backwards", function() {
        var needle = 'test';
        var string = 'hallotest1234';
        var array = PDFSIGN._stringToUint8Array(string);
    	expect(PDFSIGN._findBackwards(array, needle, 9)).toBe(5);
    });
    
    it("stream", function () {
	pdf = PDFSIGN._loadPdf(pdfMinimal2);
        expect(pdf.stream.bytes[929]).toBe(102);
    });
	
    it("find", function () {
	pdf = PDFSIGN._loadPdf(pdfMinimal2);
        var stream = pdf.stream;
        var index = PDFSIGN._find(stream.bytes, 'startxref');
        expect(index).toBe(727);
    });
        
    it("find2", function () {
	pdf = PDFSIGN._loadPdf(pdfMinimal2);
        var stream = pdf.stream;
        var index = PDFSIGN._find(stream.bytes, 'startxref', 727, 736);
        expect(index).toBe(727);
    });
	
    it("find xref1", function () {
	pdf = PDFSIGN._loadPdf(pdfMinimal2);
        expect(PDFSIGN._findFreeXrefNr(pdf.xref.entries)).toBe(6);
        expect(PDFSIGN._findFreeXrefNr(pdf.xref.entries, [6])).toBe(7);
    });
	
    it("find xref2", function () {
        pdf = PDFSIGN._loadPdf(pdfMinimalGap);
        expect(PDFSIGN._findFreeXrefNr(pdf.xref.entries)).toBe(5);
        expect(PDFSIGN._findFreeXrefNr(pdf.xref.entries, [5])).toBe(7);
    });
	
    it("string conversion", function () {
	var s = "testmenow!";
	expect(PDFSIGN._uint8ArrayToString(PDFSIGN._stringToUint8Array(s))).toBe(s);
    });
	
    it("instert to array", function () {
    	var s = "testmenow!";
	var array = PDFSIGN._stringToUint8Array(s);
	expect(PDFSIGN._uint8ArrayToString(PDFSIGN._insertIntoArray(array, 0, 'UU'))).toBe('UUtestmenow!');
	expect(PDFSIGN._uint8ArrayToString(PDFSIGN._insertIntoArray(array, 1, 'UU'))).toBe('tUUestmenow!');
	expect(PDFSIGN._uint8ArrayToString(PDFSIGN._insertIntoArray(array, 9, 'UU'))).toBe('testmenowUU!');
	expect(PDFSIGN._uint8ArrayToString(PDFSIGN._insertIntoArray(array, 10, 'UU'))).toBe('testmenow!UU');
    });
	
    it("find root entry", function () {
    	pdf = PDFSIGN._loadPdf(pdfMinimal2);
        expect(PDFSIGN._findRootEntry(pdf.xref)).toBe(pdf.xref.entries[1]);
    });
        
    it("find next entry", function () {
        pdf = PDFSIGN._loadPdf(pdfMinimal2);
        //the next entry is 5 as we have a revision as the root entry
        expect(PDFSIGN._findSuccessorEntry(pdf.xref.entries, pdf.xref.entries[1])).toBe(pdf.xref.entries[5]);
    });
        
    it("find sigflag false", function () {
        pdf = PDFSIGN._loadPdf(pdfMinimal2);
        expect(PDFSIGN._isSigInRoot(pdf.xref, pdf.stream)).toBe(false);
    });
        
    it("find sigflag true", function () {
        pdf = PDFSIGN._loadPdf(pdfMinimalSigned);
        expect(PDFSIGN._isSigInRoot(pdf)).toBe(true);
    });
    
    it("xref blocks", function () {
        pdf = PDFSIGN._loadPdf(pdfMinimal2);
        expect(PDFSIGN._findXrefBlocks(pdf.xref.xrefBlocks).length).toBe(2);
    });
    
    it("xref stream", function () {
        pdf = PDFSIGN._loadPdf(pdfMinimalSigned);
        expect(PDFSIGN._findXrefBlocks(pdf.xref.xrefBlocks).length).toBe(2);
    });
    
    it("sign2", function () {
        newPDF = PDFSIGN.signpdf(pdfmini, cert, '1234', new Date(1450365030990));
        arrayEquals(newPDF, pdfminiSigned);
    });
        
    it("sign", function () {
        newPDF = PDFSIGN.signpdf(pdfMinimal2, cert, '1234', new Date(1450365030990));
        arrayEquals(newPDF, pdfAlreadySigned);
    });
    
    it("sort", function () {
        var dict = []; 
        dict[2] = "two";
        dict[1] = "one";
        dict[3] = "three";
        var sorted = PDFSIGN._sortOnKeys(dict);
        expect(JSON.stringify(sorted)).toBe('{\"1\":\"one\",\"2\":\"two\",\"3\":\"three\"}');
    });
    
    it("sha256", function () {
        var array = PDFSIGN._stringToUint8Array('test\nxref\ntest');
        var hex = sha256(array, false);
        expect(hex).toBe('9c2714b51ecb2084c8897a72f4f589b4e4d668282140c4c8cdb02bb6335b711e');
    });
    
    it("createXrefTable", function () {
        var xrefEntries = []; 
        xrefEntries[2] = {offset: 3, gen: 0, free:false};
        xrefEntries[1] = {offset: 4, gen: 0, free:false};
        xrefEntries[3] = {offset: 5, gen: 0, free:false};
        xrefEntries[5] = {offset: 6, gen: 0, free:false};
        xrefEntries[7] = {offset: 7, gen: 0, free:false};

        var text = PDFSIGN._createXrefTable(xrefEntries);
        var expected = 'xref\n1 3\n0000000004 00000 n \n0000000003 00000 n \n0000000005 00000 n \n5 1\n0000000006 00000 n \n7 1\n0000000007 00000 n \n';
        
        expect(text).toBe(expected);
    });
    
    it("findfreexref", function () {
        var xrefEntries = []; 
        xrefEntries[2] = {free:false, uncompressed: false};
        xrefEntries[1] = {free:false, uncompressed: false};
        xrefEntries[3] = {free:false, uncompressed: false};
        xrefEntries[5] = {free:false, uncompressed: false};
        xrefEntries[7] = {free:false, uncompressed: false};

        var free = PDFSIGN._findFreeXrefNr(xrefEntries);
        expect(free).toBe(4);
        free = PDFSIGN._findFreeXrefNr(xrefEntries, [4]);
        expect(free).toBe(6);
        free = PDFSIGN._findFreeXrefNr(xrefEntries, [4, 6]);
        expect(free).toBe(8);
    });
    
    it("find", function () {
        var text = PDFSIGN._stringToUint8Array('test\nxref\ntest');
        var index = PDFSIGN._find(text, '\nxref\n');
	expect(index).toBe(4);        
    });
    
    it("copy to end", function () {
        var array = PDFSIGN._stringToUint8Array('testarray');
        array = PDFSIGN._copyToEnd(array, 4, 6);
        var str = PDFSIGN._uint8ArrayToString(array);
        expect(str).toBe('testarrayar');
    });
    
    it("sign twice", function () {
        newPDF = PDFSIGN.signpdf(pdfAlreadySigned, cert2, '1234', new Date(1450365030990));
        arrayEquals(newPDF, pdfAlreadySignedTwice);
    });
    
    it("sign three times", function () {
        newPDF = PDFSIGN.signpdf(pdfAlreadySignedTwice, cert, '1234', new Date(1450365030990));
        arrayEquals(newPDF, pdfAlreadySignedThree);
    });
    
});
